The 24 participating teams are divided into 6 groups, with four teams in each group. Each team must play only one game with the other three teams, for a total of 6 games. Each game is 90 minutes, and the winner A draw and a loss will result in 3, 1, and 0 points respectively. The two teams with the highest scores in each group and the 4 best third-placed teams will advance to the knockout round.

If there are teams with the same points, their ranking will be determined according to the following rules:

a. Points from mutual competitions;
b. The goal difference between mutual matches;
c. number of goals scored in mutual matches;
d. The number of away goals between mutual matches;
e. If there are still teams that have not been ranked after applying the a-d rules, then apply the a-d rules to compare the unranked teams. If such a cycle still cannot be confirmed, the ranking will be determined according to the f-j rules;
f. Goal difference in group matches;
g. number of goals scored in group matches;
h. number of away goals in group matches;
i. Fair play scores;
j. UEFA ranking.
